import React from "react";
import './login.css';
import { Link } from 'react-router-dom';


const Login = () => {
    return (
        <div>
            <h1>Login</h1>
            <Link to="/">
                <button>Home</button>
            </Link>
        </div>
    );
};

export default Login;
